// src/components/Navbar.js
import React from 'react';
import styled from 'styled-components';
import { FaReact } from 'react-icons/fa';

const Nav = styled.nav`
  background: #0b59de;
  height: 60px;
  display: flex;
  justify-content: space-between;
  padding: 0 20px;
  align-items: center;
  color: #fff;
  position: sticky;
  top: 0;
  z-index: 999;
`;

const NavLogo = styled.a`
  color: #f2f2f2;
  display: flex;
  align-items: center;
  text-decoration: none;
  font-size: 24px;
`;

const NavMenu = styled.div`
  display: flex;
  gap: 20px;
`;

const NavItem = styled.a`
  color: #fff;
  text-decoration: none;
  &:hover {
    color: #de6e0b;
  }


`;

function Navbar() {
  return (
    <Nav>
      <NavLogo href="#">
        <FaReact style={{ marginRight: '10px' }} />
        CODEV
      </NavLogo>
      <NavMenu>
      <section id="home">Home</section>
      <section id="surface-selection">Surface Selection</section>
      <section id="peptide-selection">Peptide Selection</section>
      <section id="glossary">Glossary</section>
      <section id="features">Features</section>
      <section id="contact">Contact Us</section>
      </NavMenu>
    </Nav>
  );
}

export default Navbar;
